import './home.css';
import { useState, useEffect } from 'react';
import axios from 'axios';

const Home = () => {
    const [cata, setCata] = useState({ meals: [] });

useEffect(() => {
    const fetchData = async () => {
        const result = await axios(
            'https://jsonplaceholder.typicode.com/users',
        );

        setCata(result.cata);
    };

    fetchData();
}, []);
    console.log(cata)
    return (
        <div>
            <h1>Home</h1>
            {cata.length()>0 && cata.map(val => (
                <h1>Meal : {val.name}</h1>
            ))}
        </div>
    );
}

export default Home;
